import React from "react";
import CategoryHeader from "./categoryHeader/categoryHeader";
import CategoryItem from "./categoryItem/categoryItem";
// import getCategories from "../../api/getCategories";

export default function Category (props) {

    const category = [{title: 'A Faire', issues: [{title: 'Tache n°1', dueDate: new Date(), user: 'Audrey', checklist: [{isChecked: false, description: 'test n°1'}, {isChecked: false, description: 'test n°2'}]}]}];
    return (
        <div className="">
            <CategoryHeader>
                {category[0].title}
            </CategoryHeader>
            <CategoryItem category={category[0].issues}/>
        </div>
    );
}
